// AccessKey.js
import React, { Component, Img } from 'react';
import App from '../App'
import { Menu, Icon, Layout, Breadcrumb, Footer } from 'antd';
// eslint-disable-next-line
import { BrowserRouter as Router, Route, Link, Switch, Redirect } from 'react-router-dom';
// eslint-disable-next-line
//import {Card, Badge, Row, Col, Button, Menu, Icon, Layout, Avatar} from 'antd';
  import SideNav from 'sider';
  import MainContainer from 'MainContainer';
  import SpanContainer from 'SpanContainer';

class AccessKey extends Component {
  constructor (props) {
    super(props);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.input = props.input;
  }
  state = {
    show: true
  }
  handleSubmit (e) {
    if (this.input.value === "0" && this.state.show === true) {
      e.preventDefault();
    }
  }
  render () {
    return (
      <Layout>
      <SideNav/>
      <Layout style={{ marginLeft: 200 }}>
        <SpanContainer show={false}/>
        <Footer style={{ textAlign: 'center' }}>
          Designed by Nicky Laczko
        </Footer>
      </Layout>
    </Layout>
    )
  }
}

export default AccessKey;
